import{
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledButtonDropdown,
    DropdownToggle, 
    DropdownMenu,
    DropdownItem,
    NavbarText
} from 'reactstrap';

export const Menu = (props) => {
    const[isOpen, setIsOpen] = useStates(false);
    const toggle = () => setIsOpen(!isOpen);

    return(
        <div>
            <h1>Menu</h1>
        </div>
    )
}
